import React from 'react'
function TodoList(todos) {
    return (
        <div>
            {todos.map((todo) => {
                return (
                    <input type='text' className='newtodo'>
                        {todos.title}
                    </input>
                )
            })}
        </div>
    )
}
export default TodoList
